import UploadVideoForm from "../../components/videoUploadForm/VideoUploadForm";
import "./UploadVideo.css";

function UploadVideo() {
  return (
    <div className="uploadVideo">
      <UploadVideoForm></UploadVideoForm>
    </div>
  );
}

export default UploadVideo;
